import datetime as dt
from datetime import date
from collections import Counter
import datetime as dt



class Record:
    def __init__(self, amount, comment, date=None):
        try:
            if date is not None:
                date = dt.datetime.strptime(date, '%d.%m.%Y')
            else:
                date = dt.datetime.now()
        except TypeError:
            return 'Invalid date. Enter date in format "dd.mm.yy"'

        self.amount = amount
        self.comment = comment
        self.date = date

    def show(self):
        print(f'сумма: {self.amount} \ дата: {self.date} \ комментарий: {self.comment}')


test = Record(100, 'this is no comment')

test.show()

def prt(nums):
    my_dict = Counter(nums)
    # valu = max(my_dict.values())
    res = []
    print(my_dict)
    for k, v in my_dict.items():
        if v > (len(nums) // 3):
            res.append(k)
    return res


